import React from 'react';

const AboutMe: React.FC = () => {
    return (
        <section id="about-me">
            <h2>About Me</h2>
            <p>
                Hello! I'm [Your Name], a passionate web developer with a love for creating dynamic and responsive web applications. 
                I have experience in various technologies and enjoy learning new skills to enhance my craft.
            </p>
            <p>
                In my free time, I enjoy [your hobbies or interests]. I believe in continuous learning and strive to improve my skills every day.
            </p>
        </section>
    );
};

export default AboutMe;
